import React from "react";
const Card = (item) => {
    return (
        <>
            <div className="daily_div1">
                <p className="daily_day">Today</p>
                <p className="daily_date">19/12</p>
                <p className="daily_temp">{item.day.avgtemp_c} &deg;c</p>
                <img className="weather_icon_daily" alt="Error" src={item.condition.icon ? item.condition.icon : alternate} />
            </div>
        </>
    )
}
export default Card;
